import React from 'react';

class CommitteeSSC extends React.Component {
    constructor(props: any){
        super(props)
    }

    render(){
        return (
            <>
                <div className="page-header row no-gutters py-4">
                    <div className="col-12 col-sm-4 text-center text-sm-left mb-0">
                        <span className="text-uppercase page-subtitle">Committee</span>
                        <h3 className="page-title">Committee - SRMC</h3>
                    </div>
                </div>
                <div className="row">
                    <div className="col-lg col-md-6 col-sm-6 mb-4">
                        <p className='text-red-700'>To be updated</p>
                    </div>
                </div>
            </>
        )
    }
}

export default CommitteeSSC;
